import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbaradmin from '../Layout/Navbaradmin';
import { Link } from 'react-router-dom';
import { Nav, NavDropdown, Dropdown, DropdownButton, Button } from 'react-bootstrap'


function AddEmployee(props) {
  return (
    <div>
      <Navbaradmin></Navbaradmin>
      <br></br>
      <div className="container">
        <div className="row">
          <div className="col-md-4 offset-md-4 border rounded  mt-2 shadow">
            <h2 className="text-center m-4">Admin Login</h2>
            <form onSubmit={(e) => handleSubmit(e)}>
              <div className="mb-3">
                <Button>AddEmployee</Button>
                <Button>Add Manager</Button>
              </div>
              <br></br>
            </form>
          </div>

        </div>
      </div>

    </div>
  );
}

export default AddEmployee;
